.testTestValidCSS {
  color: #1797c0;
  font-family: Arial , Helvetica , sans-serif;
  background: #1797c0 url(/img/alohaSkin/gradient_body.png) repeat-x;
  overflow: hidden;
  position: absolute;
  left: 0;
  right: 0;
  top: 0;
  bottom: 0;
  padding: 0;
  margin: 0;
}
.testTestValidCSS #mask {
  position: absolute;
  right: 0;
  left: 0;
  top: 25px;
  bottom: 25px;
  margin: 15px;
  background-color: white;
  opacity: .60;
  -moz-border-radius: 20px;
  -webkit-border-radius: 20px;
}
.testTestValidCSS .east {
  width: 200px;
  margin: 25px;
  margin-top: 20px;
  left: 0;
}
.testTestValidCSS .center {
  margin: 25px;
  left: 210px;
  right: 0;
}
.testTestValidCSS .content {
  background: #eeeeee url(/img/alohaSkin/gradient_body.png) repeat-x;
  position: absolute;
  top: 25px;
  bottom: 25px;
  overflow-x: hidden;
  overflow-y: auto;
  padding: 0;
  -moz-border-radius: 20px;
  -webkit-border-radius: 20px;
}
.testTestValidCSS .detail {
  padding: 50px 100px;
  font-size: 75%;
}
.testTestValidCSS .detailList {
  width: 100%;
  table-layout: fixed;
}
.testTestValidCSS .detailList td {
  padding: 5px;
}
.testTestValidCSS .labelCol {
  color: #4a4a56;
  font-weight: bold;
  width: 15%;
}
.testTestValidCSS #content #footer {
  position: absolute;
  bottom: 5px;
  width: 100%;
  text-align: center;
}
.testTestValidCSS .label {
  color: #4a4a56;
}
.testTestValidCSS .toolbar {
  right: 5px;
  left: 5px;
  height: 20px;
  background-color: #1797c0;
  position: absolute;
  z-index: 1;
  padding: 2px 10px;
}
.testTestValidCSS .toolbar .widget {
  height: 20px;
  width: 20px;
  background-color: white;
  -moz-border-radius: 2px;
  -webkit-border-radius: 2px;
  color: #1797c0;
  text-align: center;
  float: right;
  margin: 0px 1px;
}
.testTestValidCSS .toolbar.south .widget {
  background-color: #1797c0;
  color: white;
  -moz-transform: rotate(-30deg);
  -webkit-transform: rotate(-30deg);
}
.testTestValidCSS .toolbar .widget.search {
  width: 200px;
  background-color: #cfeef8;
  -moz-border-radius-bottomright: 10px;
  -webkit-border-bottom-right-radius: 10px;
  margin-right: -7px;
}
.testTestValidCSS .north {
  top: 0;
  -moz-border-radius-bottomright: 10px;
  -moz-border-radius-bottomleft: 10px;
  -webkit-border-bottom-right-radius: 10px;
  -webkit-border-bottom-left-radius: 10px;
}
.testTestValidCSS .south {
  bottom: 0;
  background-color: #cfeef8;
  -moz-border-radius-topright: 10px;
  -moz-border-radius-topleft: 10px;
  -webkit-border-top-right-radius: 10px;
  -webkit-border-top-left-radius: 10px;
}
.testTestValidCSS .sidebar .module {
  font-size: 75%;
  -moz-border-radius: 20px;
  -webkit-border-radius: 20px;
  margin: 5px;
  margin-bottom: 20px;
  background-color: #cfeef8;
}
.testTestValidCSS .sidebar .moduleContent {
  padding: 20px;
}
.testTestValidCSS .header {
  -moz-border-radius-topright: 10px;
  -moz-border-radius-topleft: 10px;
  -webkit-border-top-right-radius: 10px;
  -webkit-border-top-left-radius: 10px;
  background-color: #1797c0;
  position: absolute;
  left: 0;
  right: 0;
  top: 0;
  height: 23px;
  color: white;
  padding-left: 10px;
  padding-top: 2px;
}
.testTestValidCSS .sidebar .header {
  font-size: 130%;
  position: static;
  margin: 0;
  padding: 2px 0 0 10px;
}
.testTestValidCSS .header .label {
  color: #cfeef8;
}
.testTestValidCSS .auraButton {
  cursor: pointer;
  position: absolute;
  background-color: #1797c0;
  -moz-border-radius: 10px;
  -webkit-border-radius: 10px;
  bottom: 40px;
  right: 30px;
  width: 90px;
  height: 20px;
  color: white;
  text-align: center;
  padding-top: 1px;
  -moz-user-select: none;
  -khtml-user-select: none;
  user-select: none;
}
